import { StyledSignUp, ComponentSocialMedia } from "@components";
import { useTranslation } from "react-i18next";
import styled from "styled-components";

interface IProps {
    socials: JSX.Element[];
}

export const ComponentSignUpEmail = (props: IProps) => {
    //page hook
    const { t } = useTranslation();
    //page props
    const { socials } = props;
    return (
        <StyledSignUp>
            <StyledContainer 
            >
                <div className="title">

                </div>
            </StyledContainer>
            <ComponentSocialMedia socials={socials} />
        </StyledSignUp>
    );
};

const StyledContainer = styled.div`

`;
